import React from 'react';
import styled from "styled-components";
import '../App.css';

const UiComponentsStyles = () => {
  return (
    <Container>
      <H1>UI components & styles</H1>
      <Form>
        <h3>INPUTS</h3>
      </Form>
      <Buttons>
        <div>
          <form action="">
            <h5>default</h5>
            <button>Sign in</button>

            <h5>hover</h5>
            <button>Sign In</button>

            <h5>active</h5>
            <button>Sign In</button>

            <h5>disabled</h5>
            <button>Sign In</button>
          </form>
        </div>
      </Buttons>
      <Links>
        <div>
          <h5>default</h5>
          <a href="">Sign up now</a>
          <p>Contact</p>

          <h5>hover</h5>
          <a href="">Sign up now</a>
          <p>Contact</p>
          <p>Privacy</p>
          <p>Terms</p>
          <p>Forgot your password?</p>
        </div>
      </Links>
    </Container>


  )
}

const Container = styled.div`
  background: #E5E5E5;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;

`
const H1 = styled.div`
position: absolute;
width: 848px;
height: 24px;

font-family: 'Montserrat';
font-style: normal;
font-weight: 600;
font-size: 70px;
line-height: 24px;
/* identical to box height, or 34% */

text-align: center;

color: #000000;
`;

const Form = styled.form`
  h3 {
    color: #00000;
    margin-top: 5rem;
    margin-bottom: 2rem;
  }
`;

const H3 = styled.div`
position: absolute;
width: 148px;
height: 28px;

font-family: 'Montserrat';
font-style: normal;
font-weight: 700;
font-size: 38px;
line-height: 28px;
/* identical to box height, or 74% */

text-transform: uppercase;

color: #000000;

`

.default = styled.div`

`

const Buttons = styled.div`
font-family: Montserrat;
font-size: 22px;
font-weight: 700;
line-height: 28px;
letter-spacing: 0em;
text-align: left;

//styleName: h2;
font-family: Montserrat;
font-size: 20px;
font-weight: 600;
line-height: 26px;
letter-spacing: 0em;
text-align: center;

font-family: Montserrat;
font-size: 14px;
font-weight: 600;
line-height: 17px;
letter-spacing: 0em;
text-align: left;

//styleName: text;
font-family: Montserrat;
font-size: 14px;
font-weight: 600;
line-height: 24px;
letter-spacing: 0em;
text-align: left;

//styleName: h1;
font-family: Montserrat;
font-size: 28px;
font-weight: 700;
line-height: 34px;
letter-spacing: 0em;
text-align: left;

font-family: Montserrat;
font-size: 38px;
font-weight: 700;
line-height: 28px;
letter-spacing: 0em;
text-align: left;

`

const Links = styled.div`

`
export default UiComponentsStyles;
